import React from 'react'
import { useNavigate } from 'react-router-dom';

export default function CreateProducts(props) {
    const heater = () => {
        let option = <option value="heater" id="heater">Heater</option>
        if (props.heater) {
            return option
        }
        return
    }

    const stereo = () => {
        let stereo = <option value="stereo" id="stereo">Stereo</option>
        if (props.stereo) {
            return stereo
        }
        return
    }

    return (
        <div>
            <select name="type" id="type" > 
                <option value="ac" id="ac">AC</option>
                <option value="light" id="light">Light</option>
                {heater}
                {stereo}
            </select>
        </div>
    )
}
